  false,\n\t\"url\": null,\n\t\"notes\": \"The spatial component of the FAF network
  is derived from National Highway System Version 2009.11 and contains state primary
  and secondary roads, National Highway System (NHS), National Network (NN) and several
  intermodal connectors as appropriate for the freight network modeling. The network
  consists of over 447,808 miles of equivalent road mileage. The data set covers the
  48 contiguous States plus the District of Columbia, Alaska, and Hawaii. The nominal
  scale of the data set is 1:100,000 with a maximal positional error of u00c2u00b180
  meters.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
